The highest fibonacci int it can print out is 1836311903 and when it tries to print the next value, it turns the int value into a negative. This is because when it tried to find the next value, it was a lot bigger than what an int value can be. So it added as much of the value it can to the orignal int of 1836311903 and then created another int with the remaining extra int value left. This why the next output was -1323752223

Here's the code I used to determine the bonus:
public class test {
    public static void main(String[] args){
        for(int i = 0; i > -1; i++){
            bonusFib(i);
            System.out.println(bonusFib(i));
        }
        
    }
    
    public static int bonusFib(int n){
        if(n == 0){
            return 0;
        } else if(n == 1){
            return 1;
        } else {
            return bonusFib(n - 1) + bonusFib(n - 2);
        }
    }
}

/*
The result will print the largest fibonacci number printable by java, it cannot pass this value since integers cannot store numbers above 2147483648.
*/
public class Main
{
    public static void main(String[] args) {
        int j = 0;
       int result;
       do{
           result = fib(j);
           j ++;
       } while(result < 2147483647);
       System.out.println("Bonus: Highest fibonacci integer is, " +result);
    }
    public static int fib(int n)
   {
       if (n == 0)
       {
           return 0;
       } else if (n == 1)
       {
           return 1;
       } else {
           return(fib(n-1) + fib(n-2));
       }
   }
}

public class  driver{
    static int fibonacci(int n){
        if(n == 0){
            return 0;
        }else if(n == 1){
            return 1;
        }
        return fibonacci(n-1) + fibonacci(n-2);
    }

    public static void main(String[]args){
        int pos = 0;
        while(fibonacci(pos) >= 0){
            pos++;
        }
        System.out.println(fibonacci(pos-1));
    }
}

The next fibonacci number will be negative because of integer overflow. When there is an integer overflow java will start from the smallest integer which is something close to -2.1 billion.
